(self.webpackChunkacm_uic_github_io=self.webpackChunkacm_uic_github_io||[]).push([[1477],{4580:function(e){"use strict";e.exports=JSON.parse('{"blogPosts":[{"id":"gbm-fall-2021","metadata":{"permalink":"/blog/gbm-fall-2021","editUrl":"https://github.com/acm-uic/acm-uic.github.io/edit/main/blog/2021-09-06-GBM-announcement.mdx","source":"@site/blog/2021-09-06-GBM-announcement.mdx","title":"ACM General Body Meeting Announcement","description":"Hi ACM members,","date":"2021-09-06T00:00:00.000Z","formattedDate":"September 6, 2021","tags":[{"label":"general-body-meeting","permalink":"/blog/tags/general-body-meeting"},{"label":"events","permalink":"/blog/tags/events"},{"label":"SIGs","permalink":"/blog/tags/si-gs"}],"readingTime":0.755,"truncated":false,"authors":[{"name":"Sam Effendy","title":"Secretary 2021-2022 @ ACM@UIC","url":"https://github.com/dejazzhands","imageURL":"https://avatars.githubusercontent.com/u/49312226?s=100&v=4","key":"dejazzhands"}],"nextItem":{"title":"UIC In-Person Involvement Fair!","permalink":"/blog/involvement-fair-2021"}},"content":"import DiscordLink from \\"../src/components/DiscordLink\\";\\n\\nHi ACM members,\\n\\nIt is my pleasure to announce our ACM General Body Meeting, which will be held on **Friday, Sep 10th at 5PM.** You\'ll get to learn about all the exciting events we planned for this semester, as well as meet SIG leaders and learn what they are about.\\n\\nThe meeting will be in hybrid format, held in the CS Lounge (Science and Engineering Labs East, 2nd floor) and <DiscordLink>Discord</DiscordLink> simultaneously.\\n\\nThis Wednesday is the engineering org fair in the Maker Space parking lot from 12-4PM. Please make time to come by and say hi. Some orgs will also be doing demonstrations, so it will be a fun experience.\\n\\nAs we are coming up with times for our events and SIG meeting times, we would like your input to better understand what everyone\'s availability is! When you find some time please fill out this form!\\n([https://forms.gle/5D7Pdv6EpicF5UUV7](https://forms.gle/5D7Pdv6EpicF5UUV7))"},{"id":"involvement-fair-2021","metadata":{"permalink":"/blog/involvement-fair-2021","editUrl":"https://github.com/acm-uic/acm-uic.github.io/edit/main/blog/2021-08-29-Involvement-Fair.md","source":"@site/blog/2021-08-29-Involvement-Fair.md","title":"UIC In-Person Involvement Fair!","description":"Hopefully everyone is excited to be back in person this Fall, and everyone is enjoying it so far!","date":"2021-08-29T00:00:00.000Z","formattedDate":"August 29, 2021","tags":[{"label":"involvement","permalink":"/blog/tags/involvement"},{"label":"officer","permalink":"/blog/tags/officer"}],"readingTime":0.36,"truncated":false,"authors":[{"name":"Christian Bingman","title":"President 2021-2022 @ ACM@UIC","url":"https://github.com/ChristianBingman","imageURL":"https://avatars.githubusercontent.com/u/42191425?s=100&v=4","key":"cbingm2"}],"prevItem":{"title":"ACM General Body Meeting Announcement","permalink":"/blog/gbm-fall-2021"},"nextItem":{"title":"Welcome Back!","permalink":"/blog/welcome-back-2021"}},"content":"Hopefully everyone is excited to be back in person this Fall, and everyone is enjoying it so far!\\n\\nThis year\'s involvement fair will be held both **in-person and virtually** with the in-person fair being on **Aug. 31st** from 11am to 2pm and the virtual fair on **Sep. 3rd** from 11am to 5pm!\\n\\nWe will be handing out **ACM merchandise** at our in person event this Tuesday, so feel free to stop by!"},{"id":"welcome-back-2021","metadata":{"permalink":"/blog/welcome-back-2021","editUrl":"https://github.com/acm-uic/acm-uic.github.io/edit/main/blog/2021-08-22-welcome-back.mdx","source":"@site/blog/2021-08-22-welcome-back.mdx","title":"Welcome Back!","description":"It is a fresh new year, with many fresh faces which we will see in person! I hope everyone is doing well and continues to do so. A couple of updates to get the semester started!","date":"2021-08-22T00:00:00.000Z","formattedDate":"August 22, 2021","tags":[{"label":"welcome","permalink":"/blog/tags/welcome"},{"label":"officer","permalink":"/blog/tags/officer"}],"readingTime":0.81,"truncated":false,"authors":[{"name":"Christian Bingman","title":"President 2021-2022 @ ACM@UIC","url":"https://github.com/ChristianBingman","imageURL":"https://avatars.githubusercontent.com/u/42191425?s=100&v=4","key":"cbingm2"}],"prevItem":{"title":"UIC In-Person Involvement Fair!","permalink":"/blog/involvement-fair-2021"},"nextItem":{"title":"New blog \ud83d\udc4b","permalink":"/blog/new-blog"}},"content":"import DiscordLink from \\"../src/components/DiscordLink\\";\\n\\nIt is a fresh new year, with many fresh faces which we will see in person! I hope everyone is doing well and continues to do so. A couple of updates to get the semester started!\\n\\nOur website has been updated! (Though it is still a work in progress...) [acm.cs.uic.edu](https://acm.cs.uic.edu/) It will contain event details and information about our organization. **PLEASE DOWNLOAD/FOLLOW THIS CALENDAR.**\\n\\nEvent reminders and details will also be posted on <DiscordLink>Discord</DiscordLink>!\\n\\nThere will be no membership fees this year (yay), but there will be a couple fundraising events throughout the semester.\\n\\nThe office will be opened every morning on the weekdays as per usual. If there is something you need from the office please contact an officer.\\n\\nMembership sign up forms will be available at our GBM\\n\\nOur GBM is currently set for **September 10th**, so mark your calendars!\\n\\nIf anyone is interested in leading SIG WebDev this semester please reach out to an officer!"},{"id":"new-blog","metadata":{"permalink":"/blog/new-blog","editUrl":"https://github.com/acm-uic/acm-uic.github.io/edit/main/blog/2021-05-02-new-blog.md","source":"@site/blog/2021-05-02-new-blog.md","title":"New blog \ud83d\udc4b","description":"Let\'s see if we can all the old blog posts migrated here. \ud83d\ude0f","date":"2021-05-02T00:00:00.000Z","formattedDate":"May 2, 2021","tags":[],"readingTime":0.065,"truncated":false,"authors":[{"name":"Bharat Middha","title":"President 2019-2021 @ ACM@UIC","url":"https://github.com/bmiddha","imageURL":"https://avatars.githubusercontent.com/u/5100938?s=100&v=4","key":"bmiddha"}],"prevItem":{"title":"Welcome Back!","permalink":"/blog/welcome-back-2021"}},"content":"Let\'s see if we can all the old blog posts migrated here. \ud83d\ude0f"}]}')}}]);